// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CrowdFunding {
    
    // 1. Kintamieji (State Variables)
    address public manager;          // Projekto krjo adresas
    uint public targetAmount;        // Finansinis tikslas (Wei formatu)
    uint public deadline;            // Laiko pabaigos yma (timestamp)
    uint public raisedAmount;        // Kiek i viso surinkta
    
    // Mapping saugo informacij, kiek kiekvienas rmjas perved
    mapping(address => uint) public contributors;

    // 2. Konstruktorius - pasileidia tik vien kart, kuriant sutart
    // _targetETH: kiek ETH norime surinkti
    // _durationInMinutes: kiek minui galios kampanija
    constructor(uint _targetETH, uint _durationInMinutes) {
        manager = msg.sender; // Tas, kas "deploja" kontrakt, tampa valdytoju
        targetAmount = _targetETH * 1 ether; // Konvertuojame ETH  Wei (maiausi vienet)
        deadline = block.timestamp + (_durationInMinutes * 1 minutes);
    }

    // 3. Funkcija: Rmimas (Investavimas)
    function contribute() public payable {
        // Tikrinimai (Validation)
        require(block.timestamp < deadline, "Laikas baigesi, remti nebegalima.");
        require(msg.value > 0, "Pervedama suma turi buti didesne nei 0.");

        // raome rmj  sra
        if (contributors[msg.sender] == 0) {
            // ia galtume skaiiuoti unikalius rmjus, jei reikt
        }
        
        contributors[msg.sender] += msg.value; // Pridedame prie rmjo balanso
        raisedAmount += msg.value;             // Atnaujiname bendr sum
    }

    // 4. Funkcija: Pinig imokjimas krjui (Skms atveju)
    function withdraw() public {
        require(msg.sender == manager, "Tik projekto kurejas gali inicijuoti ismokejima.");
        require(raisedAmount >= targetAmount, "Finansinis tikslas nepasiektas.");
        // Pastaba: Galima leisti isiimti ir anksiau, jei tikslas pasiektas, 
        // bet saugiau palaukti termino pabaigos arba tiesiog tikrinti sum.
        
        uint balance = address(this).balance;
        payable(manager).transfer(balance); // Pervedame visus kontrakte esanius pinigus krjui
    }

    // 5. Funkcija: Pinig susigrinimas (Neskms atveju)
    function getRefund() public {
        // Leidiame grinti tik jei laikas baigsi IR tikslas nebuvo pasiektas
        require(block.timestamp >= deadline, "Kampanija dar vyksta.");
        require(raisedAmount < targetAmount, "Tikslas pasiektas, grazinimas negalimas.");
        require(contributors[msg.sender] > 0, "Jus nesate paremes sio projekto.");

        uint amountToRefund = contributors[msg.sender];
        
        // Saugumo praktika: Pirmiausia anuliuojame balans, tada pervedame (apsauga nuo Re-entrancy atak)
        contributors[msg.sender] = 0; 
        
        payable(msg.sender).transfer(amountToRefund);
    }

    // Pagalbin funkcija: likusio laiko patikrinimui (sekundmis)
    function timeLeft() public view returns (uint) {
        if (block.timestamp >= deadline) {
            return 0;
        } else {
            return deadline - block.timestamp;
        }
    }
}
